import React, { Component } from "react";
import avatar from "./avatar.jpg";

class PVModePersonalDetails extends Component {
  render() {
    return (
      <div className="flex flex-col space-y-4 bg-slate-400 w-2/6">
        <div className="m-5">
          <img src={avatar} />
        </div>

        <div className="flex flex-col space-y-2 m-5">
          <h1 className="pvHeader"> Personal Details</h1>
          <div className="space-y-2">
            <div>
              <p>Address </p>
            </div>
            <div>
              <p>Phone Number</p>
            </div>
            <div>
              <p> </p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default PVModePersonalDetails;
